import React from 'react'
import './Programs.css'

const Programs = () => {
  return (
    <div className="Programs" id="programs">
        <div className="programs-header">
            <span className='stroke'>Explore our</span>
            <span>Programs</span>
            <span>to shape you</span>
        </div>
    </div>
  )
}

export default Programs;
